function getNumberOfValueCarriers(cid){

  let valueCarriers = [];

  for (let valueCarrierEntity of cid){

    let valueOfActualWeight = 100 *valueCarrierEntity[1];

    switch (valueCarrierEntity[0]){

      case ("PENNY"):

        valueCarriers.push([1, Math.round(valueOfActualWeight/1,0)]);

        break;

      case ("NICKEL"):

        valueCarriers.push([5, Math.round(valueOfActualWeight/5,0)]);
        break;

      case ("DIME"):

        valueCarriers.push([10, Math.round(valueOfActualWeight/10,0)]);
        break;

      case ("QUARTER"):

        valueCarriers.push([25, Math.round(valueOfActualWeight/25,0)]);
        break;

      case ("ONE"):

        valueCarriers.push([100, Math.round(valueOfActualWeight/100,0)]);
        break;

      case ("FIVE"):

        valueCarriers.push([500, Math.round(valueOfActualWeight/500,0)]);
        break;

      case ("TEN"):

        valueCarriers.push([1000, Math.round(valueOfActualWeight/1000,0)]);
        break;

      case ("TWENTY"):

        valueCarriers.push([2000, Math.round(valueOfActualWeight/2000,0)]);
        break;

      case ("ONE HUNDRED"):
        valueCarriers.push([10000, Math.round(valueOfActualWeight/10000,0)]);
        break;

    }
  }

  return valueCarriers;
}

function convertToChange(valueCarriers){

  let createdChange = [];

  for (let valueCarrierEntity of valueCarriers){

    switch (valueCarrierEntity[0]){

      case (1):

        createdChange.push(["PENNY", valueCarrierEntity[1]]);

        break;

      case (5):

        createdChange.push(["NICKEL", valueCarrierEntity[1]]);
        break;

      case (10):

        createdChange.push(["DIME", valueCarrierEntity[1]]);
        break;

      case (25):

        createdChange.push(["QUARTER", valueCarrierEntity[1]]);
        break;

      case (100):

        createdChange.push(["ONE", valueCarrierEntity[1]]);
        break;

      case (500):

        createdChange.push(["FIVE", valueCarrierEntity[1]]);
        break;

      case (1000):

        createdChange.push(["TEN", valueCarrierEntity[1]]);
        break;

      case (2000):

        createdChange.push(["TWENTY", valueCarrierEntity[1]]);
        break;

      case (10000):

        createdChange.push(["ONE HUNDRED", valueCarrierEntity[1]]);
        break;

    }
  }

  return createdChange;
}

function checkCashRegister(price, cash, cid) {

  price = 100 * price;
  cash = 100 * cash;
  let valueCarriers = getNumberOfValueCarriers(cid);
  let returnCarriers = [];

  let change = cash - price;

  let continueCreateChange = true;

  var cashInDrawerIndex = cid.length - 1;


  while(continueCreateChange){

    let numberOfValueCarriers = Math.floor(change/valueCarriers[cashInDrawerIndex][0],0);

      if(numberOfValueCarriers <= valueCarriers[cashInDrawerIndex][1]){

        returnCarriers.push([valueCarriers[cashInDrawerIndex][0],valueCarriers[cashInDrawerIndex][0]*numberOfValueCarriers/100]);
        change -= numberOfValueCarriers * valueCarriers[cashInDrawerIndex][0];
      }else{

        returnCarriers.push([valueCarriers[cashInDrawerIndex][0],valueCarriers[cashInDrawerIndex][0]*valueCarriers[cashInDrawerIndex][1]/100]);
        change -=  valueCarriers   [cashInDrawerIndex][0]* valueCarriers[cashInDrawerIndex][1];

      }    


    if(cashInDrawerIndex >0){
      cashInDrawerIndex -= 1;
    }else{
      continueCreateChange = false;
    }
  }

let returnedChange = convertToChange(returnCarriers);

let valueCarriersString = valueCarriers.reverse().map(x => [x[0],x[1]/100]).toString();
let returnCarriersString = returnCarriers.toString();

console.log(valueCarriersString);
console.log(returnCarriersString);

if (change >0){

    return {status: "INSUFFICIENT_FUNDS", change: []}

}if (change == 0 && (valueCarriersString == returnCarriersString)){

    return {status: "CLOSED", change: returnedChange.reverse()}

  }else{

    return {status: "OPEN", change: returnedChange.filter(x => x[1]>0)}

  }
}

