function telephoneCheck(str) {
  //const regex1 = RegExp('\d{4}\-\d{4}\-\d{5}');
  const regex1 = RegExp('^(1 ){0,1}\\d{3}\-\\d{3}\-\\d{4}$');
  const regex2 = RegExp('^(1 ){0,1}\\(\\d{3}\\)\\d{3}\-\\d{4}$');
  const regex3 = RegExp('^(1 ){0,1}\\(\\d{3}\\) \\d{3}\-\\d{4}$');
  const regex4 = RegExp('^(1 ){0,1}\\d{3} \\d{3} \\d{4}$');
  const regex5 = RegExp('^(1 ){0,1}\\d{10}$');
  const regex6 = RegExp('^(1 ){0,1} \\d{3} \\d{3} \\d{4}$');
  const regex7 = RegExp('^(1( ){0,1}){0,1}\\(\\d{3}\\)( ){0,1}\\d{3}\-\\d{4}$');
  const regex8 = RegExp('^(1){0,1}\\(\\d{3}\\) \\d{3}\-\\d{4}$');

  return regex1.test(str) || regex2.test(str) || regex3.test(str) || regex4.test(str) || regex5.test(str) || regex6.test(str) || regex7.test(str);;
}

