function rot13(str) {
  let shiftedAlphabet = "NOPQRSTUVWXYZABCDEFGHIJKLM";
  shiftedAlphabet.split("");

  let charcodeOfA = "A".charCodeAt(0);

  return str.toUpperCase().split("").map(x => (x >= "A") && (x <= "Z")? String.fromCharCode((x.charCodeAt(0) - charcodeOfA + 13)%26 + charcodeOfA) : x).join("");


}

