function addCharacters(numberToConvert, greatestCharacter, middleCharacter, smallestCharacter, convertedString){
    if(numberToConvert == 9){
    convertedString += smallestCharacter + greatestCharacter;
  }else{
    if(numberToConvert >= 5){
      convertedString += middleCharacter;
      numberToConvert -= 5;
      while(numberToConvert > 0){
        convertedString += smallestCharacter;
        numberToConvert -= 1;
      }
    }else{
      if (numberToConvert == 4){
        convertedString += smallestCharacter + middleCharacter;
      }else{
        while(numberToConvert > 0){
          convertedString += smallestCharacter;
          numberToConvert -= 1;
        }
      }
    }
  }
  return convertedString;
}

function convertToRoman(num) {

  let numberOfThousends = Math.floor(num/1000,0);
  let numberOfHundrets =  Math.floor((num % 1000)/100,0);
  let numberOfTens = Math.floor((num%100)/10,0);
  let numberOfOnes = Math.floor(num%10,0);

  let convertedString = "";

  while(numberOfThousends > 0){
    convertedString += "M";
    numberOfThousends -= 1;
  }

  convertedString = addCharacters(numberOfHundrets, "M", "D", "C",convertedString);
  convertedString = addCharacters(numberOfTens, "C", "L", "X",convertedString);
  convertedString = addCharacters(numberOfOnes, "X", "V", "I",convertedString);

 return convertedString;
}

