function palindrome(pallindromeString ) {

  let regex2Test = RegExp("[a-z0-9]","i");
  let str2Test = pallindromeString.toLowerCase().split("").filter(x => regex2Test.test(x));

  let isPalindrome = true;
  let index = 0;
  let upperBorder = str2Test.length/2;

  while(isPalindrome && index <= upperBorder){
    if(str2Test[index] == str2Test[str2Test.length-index-1]){
      index += 1;
    }else{

      isPalindrome = false;
    }
  }

  return isPalindrome;

}

